import React from 'react';
import { Box, ModalBody, Button, Heading } from '@chakra-ui/react';
import { BsPlay, BsFileEarmarkCode } from 'react-icons/bs';

const Maps = () => {
  return (
    <Box>
      <ModalBody>
        <Button
          mr={5}
          leftIcon={<BsFileEarmarkCode />}
          colorScheme="blue"
          size="lg"
        >
          <Link
            as="a"
            _hover={{ textDecor: 'none' }}
            href="https://github.com/sumantguha/Java-Style-Checker"
            isExternal={true}
          >
            View Source Code
          </Link>
        </Button>
        <Button
          leftIcon={<BsPlay />}
          colorScheme={firstColor}
          size="lg"
          disabled={true}
        >
          Try Now (Coming Soon!)
        </Button>
        <br />
        <br />
      </ModalBody>
    </Box>
  );
};

export default Maps;
